import React from "react";

import { createStackNavigator } from "@react-navigation/stack";
import MaterialListScreen from "./screens/materiales/MaterialListScreen";
import DetalleMaterialScreen from "./screens/materiales/DetalleMaterialScreen";
import ReservasScreen from "./screens/movimientos/ReservasScreen";
import PrestamosScreen from "./screens/movimientos/PrestamosScreen";
import LogoutScreen from "./screens/auth/LogoutScreen";

const Stack = createStackNavigator();

const AppTabsScreen = ({ setIsLoggedIn }) => (
  <Stack.Navigator>
    <Stack.Screen name="Materiales" component={MaterialListScreen} />
    <Stack.Screen name="DetalleMaterial" component={DetalleMaterialScreen} />
    <Stack.Screen name="Reservas" component={ReservasScreen} />
    <Stack.Screen name="Prestamos" component={PrestamosScreen} />
    <Stack.Screen
      name="Logout"
      children={(props) => (
        <LoginScreen {...props} setIsLoggedIn={setIsLoggedIn} />
      )}
    />
  </Stack.Navigator>
);

export default AppTabsScreen;
